a = ""

# Version 01
@profile
def main01():
  largest = 0
  for i in xrange(len(a) - 4):
    n1, n2, n3, n4, n5 = int(a[i]), int(a[i+1]), int(a[i+2]), int(a[i+3]), int(a[i+4])
    p = n1*n2*n3*n4*n5
    largest = max(largest, p)
  # Code here
  printAnswer(largest)

# Version 02
@profile
def main02():
  largest = 0
  for i in xrange(len(a) - 4):
    n = [int(a[i+j]) for j in range(5)]
    p=prod(n)
    largest = max(largest, p)
  # Code here
  printAnswer(largest)

main01()
main02()
